const StateWiseData=()=>{
    const []=useState();
    const getCovidData=async()=>{
         const res=await fetch('https://api.covid19india.org/data.json');
         const actualData=awres.json();
        }
    useEffect(
        ()=>{
           getCovidData();
        },[]
    )
    return(
        <>
           <h1>INDIA COVID-19 DASHBOARD</h1> 
        </>
    );
} 
export default StateWiseData;
